    false,nt"url": null,nt"notes": "An aerial photograph is a photograph of
    the earth's surface taken with a camera mounted in an airplane. The geographic extent
    of this scanned, georectified, and mosaiced 1.5-meter pixel resolution black and
    white digital aerial photograph is approximately the Payette Valley in Idaho. 26
    tiles acquired as part of the 1949 Payette Valley Air Photo Project are included
    in this mosaic. The collection area includes some of southwestern Gem County, central
    Payette county, and parts of southern Washington county. The 1:20,000-scale black
    and white aerial photography used in the production of this mosiaced image was flown
    in 1938, 1943, and 1949 by the Soil Conservation Service, Boise, Idaho.",nt"license_title":
